import React from "react";
function Row(props, { title }) {
  return (
    <div className="row">
      <h2>{props.title}</h2>
      <div className="row_posters">
        {}
        {props.animeListaNovidades.map((anime) => (
          <a
            className="row_poster"
            href={anime.url}
            target="_blank"
            rel="noreferrer"
          >
            <figure>
              <img
                className="poster"
                key={anime.rank}
                src={anime.image_url}
                alt=""
              />
            </figure>
          </a>
        ))}
      </div>
    </div>
  );
}
export default Row;
